import WebNavbar from "./component/header/Navbar";
import { BrowserRouter as Router,Route,Switch } from "react-router-dom";

function App() {

  return (
    <Router>
      <WebNavbar/>
      <Switch>
        <Route to="/openaccount" component={<div>openaccount</div>}></Route>
      </Switch>
    </Router>

  );
}

export default App;
